import "./auth.css"
import { initializeApp } from "firebase/app";
import {  getAuth, signOut } from "firebase/auth";
import {  useNavigate } from "react-router-dom";


function Logout() {

    const navigate=useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyDAm1l6txCkIKB3EQsvt-L-6qgluOJpfhI",
        authDomain: "auth-cc868.firebaseapp.com",
        projectId: "auth-cc868",
        storageBucket: "auth-cc868.appspot.com",
        messagingSenderId: "431111410332",
        appId: "1:431111410332:web:38ab3e03f6c3777f631359",
        measurementId: "G-GV6YBQQM6B"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()


    const submit=(event) => {
        event.preventDefault()

        signOut(auth)

            .then(() => {
                alert("successfully Logout...")
                navigate("/login")
            })
            .catch(() => {
                alert("error...")
            })
    }


    return (
      
                <div >
                    <h3 className="text-center">Wellcome...!</h3>
        
                    <form onSubmit={submit}>  

                        <button type="submit" class="btnlogout btnlogout-primary">Logout</button>

                    </form>

            </div>

    )
}
export default Logout;
